import Router from "components/Router";
import Layout from 'components/Layout'
import './App.css';
function App({Component}) {
  return (
    <div className="App">
      <header className="App-header">
        <Layout children={<Component />} />
        <Router/>
      </header>
    </div>
  );
}

export default App;
